INSERT INTO `patterns` (`id`, `name`, `emotions`, `goal`, `judges_others`, `influences_others`, `organization_value`, `overuses`, `under_pressure`, `fear`, `effectiveness`, `description`) VALUES
(5, 'Influência Média', 'Demonstra emoções com moderação e leveza', 'Criar conexões e manter ambiente agradável', 'Julga pela empatia e sinceridade', 'Influencia com otimismo e abertura', 'Valoriza comunicação e colaboração', 'Pode ser disperso ou pouco profundo', 'Fica ansioso com críticas', 'Medo de decepcionar os outros', 'Alta em ambientes motivadores', 'Pessoa que une equipes, é comunicativa e adaptável'),
(4, 'Influência Alta', 'Expressa emoções de forma aberta e contagiante', 'Ser reconhecido e admirado', 'Julga pela simpatia e aceitação', 'Influencia com carisma e entusiasmo', 'Valoriza relacionamentos e ambiente leve', 'Pode ser impulsivo ou exagerado', 'Busca atenção ou aprovação', 'Medo de rejeição ou isolamento', 'Alta quando há interação e estímulo', 'Pessoa extrovertida, envolvente, mas precisa focar nos detalhes'),
(3, 'Dominância Baixa', 'Evita conflitos e expressa emoções de forma passiva', 'Evitar confrontos, manter estabilidade', 'Julga pela intenção e esforço', 'Influencia de forma indireta e diplomática', 'Valoriza consenso e respeito', 'Pode ceder facilmente ou ser passivo demais', 'Reage evitando decisões ou confrontos', 'Medo de ser pressionado ou forçado a liderar', 'Melhora em ambientes colaborativos', 'Pessoa que evita confronto, age com cautela, mas pode perder oportunidades por hesitação'),
(2, 'Dominância Média', 'Controla emoções, mas mantém assertividade', 'Obter resultados com equilíbrio', 'Julga pela clareza e decisões práticas', 'Influencia por determinação e exemplo', 'Valoriza eficiência e agilidade', 'Pode se tornar teimoso ou impaciente', 'Fica impaciente com lentidão ou falta de direção', 'Medo de parecer indeciso ou ineficaz', 'Alta em ambientes organizados', 'Líder focado que equilibra bem pressão e pragmatismo'),
(1, 'Dominância Alta', 'Expressa emoção de forma direta e intensa', 'Alcançar resultados rápidos', 'Julga pela competência e eficácia', 'Influencia através da força e controle', 'Valoriza eficiência e ação', 'Pode se tornar autoritário ou impaciente', 'Torna-se ainda mais controlador', 'Medo de perder o controle ou ser visto como fraco', 'Alta em situações de desafio', 'Pessoa extremamente orientada a resultados, com forte iniciativa, mas que pode atropelar os outros se não moderar sua intensidade'),
(6, 'Influência Baixa', 'Reservado, expressa emoções com cautela', 'Evitar exposição e manter a descrição', 'Julga pela consistência e respeito', 'Influencia com bons exemplos e coerência', 'Valoriza discrição e segurança emocional', 'Pode parecer frio ou distante', 'Isola-se e evita interações sociais', 'Medo de se expor ou ser mal interpretado', 'Alta em ambientes tranquilos e estáveis', 'Pessoa observadora, leal, mas precisa se abrir mais'),
(7, 'Estabilidade Alta', 'Demonstra emoções com calma e previsibilidade', 'Manter a harmonia e segurança', 'Julga pela lealdade e constância', 'Influencia com apoio e paciência', 'Valoriza rotina e relacionamentos duradouros', 'Pode resistir a mudanças', 'Fica paralisado com pressão', 'Medo de mudanças abruptas', 'Alta em ambientes estáveis', 'Pessoa confiável e consistente, mas precisa se desafiar mais'),
(8, 'Estabilidade Média', 'Mostra emoções de forma equilibrada', 'Conservar relações e ambiente saudável', 'Julga pela estabilidade emocional e confiança', 'Influencia por escuta e presença constante', 'Valoriza equilíbrio e clareza', 'Pode ser indeciso ou lento em agir', 'Reage tentando manter tudo como está', 'Medo de perder equilíbrio emocional', 'Alta quando se sente seguro', 'Pessoa empática, flexível, mas precisa tomar iniciativa'),
(9, 'Estabilidade Baixa', 'Varia emocionalmente com facilidade', 'Buscar novos estímulos ou ambientes diferentes', 'Julga pela conveniência e momento', 'Influencia por adaptação e versatilidade', 'Valoriza liberdade e novas experiências', 'Pode ser inconstante ou disperso', 'Reage fugindo de rotinas', 'Medo de ficar preso a padrões', 'Alta em situações novas e desafiadoras', 'Pessoa flexível e adaptável, mas que pode evitar compromissos longos'),
(10, 'Conformidade Alta', 'Expressa emoções com controle e precisão', 'Fazer tudo com perfeição e dentro das regras', 'Julga pela lógica e exatidão', 'Influencia com dados, planejamento e padrões', 'Valoriza qualidade e normas', 'Pode ser crítico ou rígido demais', 'Reage com cobrança e preocupação com erros', 'Medo de errar ou ser criticado', 'Alta em ambientes estruturados', 'Pessoa meticulosa, confiável e analítica, mas que precisa aceitar imperfeições'),
(11, 'Conformidade Média', 'Demonstra emoções de forma racional e tranquila', 'Fazer certo, mas com flexibilidade', 'Julga pela ética e precisão razoável', 'Influencia pelo exemplo técnico e coerente', 'Valoriza organização e responsabilidade', 'Pode ser metódico demais', 'Reage com cautela excessiva', 'Medo de desorganização ou caos', 'Alta em equipes organizadas', 'Pessoa que entrega qualidade com equilíbrio, mas que pode resistir à inovação'),
(12, 'Conformidade Baixa', 'Expressa emoções livremente, com pouca autocrítica', 'Focar mais no resultado do que no processo', 'Julga pelo impacto prático', 'Influencia por praticidade e ousadia', 'Valoriza liberdade e inovação', 'Pode ignorar detalhes ou regras', 'Reage com impulsividade', 'Medo de burocracias e limitações', 'Alta em ambientes dinâmicos', 'Pessoa criativa e ousada, mas precisa cuidar da organização'),
(13, 'Perfil Composto: D/I', 'Combina assertividade com carisma', 'Influenciar pessoas e alcançar resultados', 'Julga pela iniciativa e envolvimento', 'Influencia com energia e presença marcante', 'Valoriza ação e comunicação', 'Pode ser impulsivo e impaciente', 'Reage com dominância e teatralidade', 'Medo de parecer fraco ou irrelevante', 'Alta quando há liberdade para liderar', 'Líder nato, que motiva, age rápido e inspira, mas precisa ouvir mais'),
(14, 'Perfil Composto: S/C', 'Demonstra emoções com calma e cautela', 'Garantir segurança e excelência', 'Julga pela confiança e consistência', 'Influencia com exemplo e estrutura', 'Valoriza previsibilidade e ordem', 'Pode resistir a improvisos ou mudanças rápidas', 'Reage com retraimento e análise', 'Medo de erros ou rompimentos', 'Alta em ambientes organizados e estáveis', 'Pessoa sensível, estruturada e comprometida, mas precisa de flexibilidade para crescer');
